class Solution:
    def isBipartite(self, graph: List[List[int]]) -> bool:
        color = [[0 for _ in range(101)] for _ in range(101)]
        visited = [[False for _ in range(101)] for _ in range(101)]
        n = len(graph)

        for i in range(n):
            if not visited[i][0]:
                self.dfs(i, 0, graph, color, visited)

        return True

    def dfs(self, u, c, graph, color, visited):
        visited[u][c] = True
        color[u] = c
        for v in graph[u]:
            if not visited[v][0]:
                if not self.dfs(v, 1 - c, graph, color, visited):
                    return False
            elif color[v] == c:
                return False
        return True
